description:
The best way to raise the stakes while being competitive playing video games with your pals is to make a friendly wager. The randy roomies Abigail, Ariana, and Niki decided to bet who would have to take their top off if they lost. It was all a big excuse to drop the controllers and start pushing each other's buttons. They definitely leveled up and figured out their cheat codes for maximum pleasure. With roomies like these who needs a boyfriend?


